import { Card, CardMedia, Container, Stack, Typography } from "@mui/material";
import { Box } from "@mui/system";
import React from "react";
import Map from "../components/Map";

const About = () => {
  return (
    <Container maxWidth="1024">
      <Stack justifyContent="center" flexDirection="row" marginBottom="60px">
        <hr style={{ border: "2px solid", maxWidth: "1024" }} />
      </Stack>
      <Stack
        justifyContent="center"
        flexDirection="row"
        gap={3}
        marginBottom="60px"
      >
        <img
          src={require("../image/ppsplace.jpg")}
          alt="pps place"
          style={{
            borderRadius: "15px",
            width: "auto",
            height: "350px",
          }}
        />

        <Typography alignSelf="center">
          <Typography variant="h5">ประวัติ PPS Water</Typography>
          <br />
          ห้างหุ้นส่วนจำกัด น้ำดื่มเพิ่มพูนทรัพย์ ก่อตั้งเมื่อปี พ.ศ. 2554
          <br />
          ประกอบธุรกิจนำดื่ม ผลิตโดยเครื่องจักรอัตโนมัติ ด้วยระบบ RO
          รีเวิร์สออสโมซิส (Reverse Osmosis System) <br />
          ฆ่าเชื้อด้วย UV รังสีอัลตราไวโอเลต (UltraViolet) ที่ได้มาตรฐาน สะอาด
          ปลอดภัย ทุกขั้นตอน จนถึงมือผู้บริโภค <br />
          มีใบอนุญาตผลิตอาหารและเลขที่อ.ย.ถูกต้องตามกฎหมาย
          เราผลิตน้ำดื่มในขนาดต่าง ๆ <br />
          โดยมีทั้งสินค้าในแบรนด์ของเรา
          และรับจ้างผลิตให้กับลูกค้าในหลากหลายธุรกิจ <br /> มีทั้งแบบสวมสลาก
          และสกรีนขวด ให้เลือกตามความต้องการ <br />
          และอำนวยความสะดวกในการขอใบอนุญาตเลขที่อ.ย.ให้กับลูกค้า
          ที่ต้องการสร้างแบรนด์ของตัวเอง <br /> ตามสโลแกน น้ำดื่มคุณภาพ
          น้ำดื่มเพิ่มพูนทรัพย์
        </Typography>
      </Stack>
      <Typography variant="h5" textAlign="center">
        แผนที่หจก.น้ำดื่มเพื่มพูนทรัพย์
      </Typography>

      <Box display="flex" gap={6} justifyContent="center" margin={4}>
        <img
          alt="map"
          src={require("../image/mappps.jpg")}
          style={{
            borderRadius: "15px",
            width: "50%",
            height: "auto",
          }}
        />
        <Map />
      </Box>
    </Container>
  );
};

export default About;
